		top: 0;
		text-align: center;
		width: 45px;
	}

	.wdt-shop-cart-widget[class*="sidebar"] .wdt-shop-cart-widget-header h3 span {
		font-size: 18px;
		right: 0;
	}

	.wdt-shop-cart-widget[class*="sidebar"] .wdt-shop-cart-widget-header h3 a {
		font-size: 0;
		line-height: 0;
		margin-right: 1px;
		overflow: hidden;
		right: 100%;
		text-indent: -9999px;
		-webkit-transform: translateX(100%);
		transform: translateX(100%);
