	.wdt-shop-cart-widget[class*="sidebar"] .wdt-shop-cart-widget-content {
		float: left;
		width: 100%;
	}

	.wdt-shop-cart-widget[class*="sidebar"] .wdt-shop-cart-widget-inner,
